const getFilenameFromPath = (path, withExtension = false) => {
  const regex = withExtension ? /(^.*[\\\/])(.+?)/ : /(^.*[\\\/])(.+?)(\.[^.]*$|$)/
  const name = path.replace(regex, 'f')
  return name
}

console.log('Test')
console.log('Res: ' + getFilenameFromPath('/images/mobile-navigation-menu-icon.png', false));

export default getFilenameFromPath
